import React from 'react';
import { Grid, Header } from 'semantic-ui-react';

class AutoNav extends React.Component {
  render() {
    return (
        <Grid Container id="autonav-page" centered columns={2}>
          <Grid.Row>
            <Grid.Column>
	      <Header as="h1" centered>AutoNav</Header>
            </Grid.Column>
            <Grid.Column>
	      <Header as="h1" centered>Some Thing</Header>
            </Grid.Column>
          </Grid.Row>
        </Grid>
    );
  };
}

export default AutoNav;
